import 'bootstrap/css/bootstrap.css!';
import 'font-awesome/css/font-awesome.css!';
import 'jquery.magnific-popup/dist/magnific-popup.css!';

import 'jquery';
import 'jquery.event.move';
import 'jquery.magnific-popup'
import 'bootstrap';

$(function() {
    $('select.changeLang').change(function() {
        $.post('/lang', {
            lang: $('select.changeLang').val()
        }).done(function() {
            setTimeout(function() {
                location.reload(true);
            }, 1e3);
        });
    });
    if (window.location && window.location.pathname && window.location.pathname.length > 0 && window.location.pathname === '/roomsettings') {
        $('body').scrollspy({
            target: '.bs-docs-sidebar',
            offset: 40
        });

        $(document).scroll(function(){
            var _cur_top = $(document).scrollTop();
            var threshold =  $('#plugcubed-install').offset().top - $('#plugcubed-install').height();
            if(_cur_top > threshold) {
                $('#sidebar').fadeOut(275);
            } else {
                $('#sidebar').fadeIn(275);
            }
        });
    }

    $(".youtube").each(function() {
        var elem = $(this);
        // Based on the YouTube ID, we can easily find the thumbnail image
        elem
            .css('background-image', 'url(https://i.ytimg.com/vi/' + this.id + '/sddefault.jpg)')
            .append($('<div/>').addClass('play'));

        $('#' + this.id).on('click', function() {
            // Create an iFrame with autoplay set to true
            var iframe_url = "https://www.youtube.com/embed/" + this.id + "?autoplay=1&autohide=1";
            if (elem.data('params')) iframe_url += '&' + elem.data('params');

            // The height and width of the iFrame should be the same as parent
            var iframe = $('<iframe/>', { 'class' :'embed-responsive-item', 'frameborder': '0', 'src': iframe_url, 'width': elem.width(), 'height': elem.height() })

            // Replace the YouTube thumbnail with YouTube HTML5 Player
            elem.replaceWith(iframe);
        });
    });

});
